    public class Solution
    {
        public int ShortestPathBinaryMatrix(int[][] grid)
        {
            if (grid[0][0] == 1)
            {
                return -1;
            }
            grid[0][0] = 1;
            Queue<(int r, int c)> q = new Queue<(int r, int c)>();
            q.Enqueue((0, 0));
            while (q.Count > 0)
            {
                (int currRow, int currCol) = q.Dequeue();

                if (currRow == grid.Length - 1 && currCol == grid[0].Length - 1)
                {
                    return grid[currRow][currCol];
                }

                foreach ((int nextRow, int nextCol) in GetDirections(currRow, currCol, grid.Length - 1, grid[0].Length - 1))
                {
                    if (grid[nextRow][nextCol] == 0)
                    {
                        grid[nextRow][nextCol] = grid[currRow][currCol] + 1;
                        //PrintGrid(grid);
                        q.Enqueue((nextRow, nextCol));
                    }
                }
            }

            return -1;
        }

        private void PrintGrid(int[][] grid)
        {
            Console.Clear();
            foreach (var row in grid.Take(10))
            {
                Console.WriteLine(string.Join(", ", row.Take(10)));
            }
        }

        public IEnumerable<(int, int)> GetDirections(int currRow, int currCol, int rowLen, int colLen)
        {
            List<(int, int)> result = new List<(int, int)>();
            if (currRow < rowLen && currCol < colLen)
            {
                result.Add((currRow + 1, currCol + 1));
            }
            if (currRow < rowLen)
            {
                result.Add((currRow + 1, currCol));
            }
            if (currCol < colLen)
            {
                result.Add((currRow, currCol + 1));
            }

            if (currRow < rowLen && currCol > 0)
            {
                result.Add((currRow + 1, currCol - 1));
            }

            if (currRow > 0 && currCol < colLen)
            {
                result.Add((currRow - 1, currCol + 1));
            }
            if (currRow > 0 && currCol > 0)
            {
                result.Add((currRow - 1, currCol - 1));
            }

            if (currRow > 0)
            {
                result.Add((currRow - 1, currCol));
            }
            if (currCol > 0)
            {
                result.Add((currRow, currCol - 1));
            }
            return result;
        }
    }
